class Baralho:    def __init__(self, ID, deck=list):        self.ID = ID        self.cartas = deck    def retirar_carta_jogador(self):    #Retira a primeira carta do jogador, ou seja, a que está na mesa nesse exato momento        del(self.cartas[0])    def colocar_no_final(self):    #Retira a carta do início e coloca no final do baralho        temp = self.cartas[0]        del(self.cartas[0])        self.cartas.append(temp)        del(temp)#Recebendo dadosnumero_de_festas = int(input())#Verifica se o numero de festa está no intervalo 0 < F <= 10^5if numero_de_festas <= 0 or numero_de_festas > 10**5:    exit()vencedores = []#Criando o Juvenal no jogojuvenal = Baralho(0, list)#Recebendo deck de jogadoresfor i in range(numero_de_festas):    #Variáveis de controle    id = 1    jogadores = []    resposta = str()    n_de_rodadas = 1    temos_um_vencedor = False    #Recebendo o baralho/deck da mesa    deck_inicial = str(input()).split()    deck_mesa = Baralho(ID=0, deck=deck_inicial)    while '-1' not in resposta:        #Recebe o baralho/deck do jogador        deck_jogador = str(input()).split()        #Adiciona o jogador e seu respectivo deck        jogador = Baralho(id, deck_jogador)        #Verifica se o caso chegou ao fim        if '-1' in deck_jogador:            break        #Adiciona o jogador a lista de jogadores da festa atual        jogadores.append(jogador)        id += 1 #Incrementa o id para o próximo jogador    carta_atual = deck_mesa.cartas[0]    #inicia o jogo    while not temos_um_vencedor or n_de_rodadas <= 1000:        empatados = []        for i in range(len(jogadores)):            jogador_atual = jogadores[i]            #Compara as cartas dos jogadores com a do deck da mesa            if len(jogador_atual.cartas) == 0:                empatados.append(jogador_atual)            elif carta_atual == jogador_atual.cartas[0]:                jogador_atual.retirar_carta_jogador()            else:                jogador_atual.colocar_no_final()        #Coloca a carta no final do baralho        deck_mesa.colocar_no_final()        carta_atual = deck_mesa.cartas[0]        #Verificando se o jogo acabou        if len(empatados) == 1:            temos_um_vencedor = True            vencedores.append(empatados[0])            break        if len(empatados) > 1:            menor = empatados[0]            for j in range(len(empatados)):                if empatados[j].ID < menor.ID:                    menor = empatados[j]            temos_um_vencedor = True            vencedores.append(menor)            break        elif n_de_rodadas == 1000:            temos_um_vencedor = True            vencedores.append(juvenal)            break        n_de_rodadas += 1#Mostra os vencedoresfor vencedor in vencedores:    print(vencedor.ID)